    console.log(this.$refs.svg)

const paths = this.$refs.svg.querySelectorAll('path')

Array.from(paths, function(v, k) {
	var offset = anime.setDashoffset(v)
	v.setAttribute('stroke-dashoffset', offset)
	anime({
		targets: v,
		strokeDashoffset: [offset, 0],
		duration:3000,
		delay: anime.random(0, 2000),
		easing: 'easeInOutSine',
		loop: false
	})
})

	}
}
